import React, { useEffect, useState }  from 'react'
import Navbar from './components/Navbar'
import Projects from "./components/Projects";
import Skills from "./components/Skills";
import About from "./components/About";
import Contact from "./components/Contact";
import './index.css'

const App = () => {
  const [colorScheme, setColorScheme] = useState('light');

  useEffect(() => {
    setColorScheme(window.matchMedia('(prefers-color-scheme: dark)').matches ? 'dark' : 'light');
  }, []);


  return (
    <main className={`text-gray-400 bg-${colorScheme === 'dark' ? 'gray-800' : 'gray-900'} body-font`}>
     
        <Navbar colorScheme={colorScheme}/>
<About colorScheme={colorScheme}/>
<Projects colorScheme={colorScheme}/>
<Skills colorScheme={colorScheme}/>
<Contact colorScheme={colorScheme}/>
        </main>
  )
}

export default App
